import useFetch from '../hooks/useFetch'

function List(){

  const list = useFetch('http://127.0.0.1:3000/service/list')
    console.log(list)
    return (
      <div id="service-list">
          <h1>Servicios Disponibles</h1>
        <ul>
        {list?.map(lis => 
        <li key={lis.id}>
          <span>Titulo</span>
          {lis.title}
          <br/>
          {lis.description}

        </li>)} 
         </ul>
      </div>
    )

 }


export default List
